import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer className="footer">
      <p>© 2024 Taxi Micheline's. Todos os direitos reservados.</p>
      <p>Endereço: R. Contos Gauchescos, 165 - Vila Santa Catarina, São Paulo - SP</p>
    </footer>
  );
}

export default Footer;
